BEGIN;
DROP TABLE IF EXISTS `live_artist_m`; CREATE TABLE IF NOT EXISTS `live_artist_m` (
    `live_artist_id` INTEGER NOT NULL,
    `live_track_id` INTEGER NOT NULL,
    `member_tag_id` VARCHAR(128),
    `solo_unit_type_id` VARCHAR(128),
    PRIMARY KEY (`live_artist_id`)
);
DROP TABLE IF EXISTS `live_track_m`; CREATE TABLE IF NOT EXISTS `live_track_m` (
    `live_track_id` INTEGER NOT NULL,
    `name` VARCHAR(128) NOT NULL,
    `name_kana` VARCHAR(128) NOT NULL,
    `title_asset` VARCHAR(128) NOT NULL,
    `sound_asset` VARCHAR(128) NOT NULL,
    `member_category` INTEGER NOT NULL,
    `member_tag_id` INTEGER NOT NULL,
    `unit_type_id` INTEGER,
    `release_tag` VARCHAR(4096), `_encryption_release_id` INTEGER NULL,
    PRIMARY KEY (`live_track_id`)
);
DROP TABLE IF EXISTS `live_setting_m`; CREATE TABLE IF NOT EXISTS `live_setting_m` (
    `live_setting_id` INTEGER NOT NULL,
    `live_track_id` INTEGER NOT NULL,
    `difficulty` INTEGER NOT NULL,
    `stage_level` INTEGER NOT NULL,
    `attribute_icon_id` INTEGER NOT NULL,
    `live_icon_asset` VARCHAR(128) NOT NULL,
    `asset_movie_id` INTEGER,
    `asset_background_id` INTEGER NOT NULL,
    `notes_setting_asset` VARCHAR(128) NOT NULL,
    `c_rank_score` INTEGER NOT NULL,
    `b_rank_score` INTEGER NOT NULL,
    `a_rank_score` INTEGER NOT NULL,
    `s_rank_score` INTEGER NOT NULL,
    `c_rank_combo` INTEGER NOT NULL,
    `b_rank_combo` INTEGER NOT NULL,
    `a_rank_combo` INTEGER NOT NULL,
    `s_rank_combo` INTEGER NOT NULL,
    `ac_flag` INTEGER NOT NULL,
    `swing_flag` INTEGER NOT NULL,
    `lane_count` INTEGER NOT NULL,
    `release_tag` VARCHAR(4096), `_encryption_release_id` INTEGER NULL,
    PRIMARY KEY (`live_setting_id`)
);
DROP TABLE IF EXISTS `normal_live_m`; CREATE TABLE IF NOT EXISTS `normal_live_m` (
    `live_difficulty_id` INTEGER NOT NULL,
    `live_setting_id` INTEGER NOT NULL,
    `capital_type` INTEGER NOT NULL,
    `capital_value` INTEGER NOT NULL,
    `default_unlocked_flag` INTEGER NOT NULL,
    `c_rank_complete` INTEGER NOT NULL,
    `b_rank_complete` INTEGER NOT NULL,
    `a_rank_complete` INTEGER NOT NULL,
    `s_rank_complete` INTEGER NOT NULL,
    PRIMARY KEY (`live_difficulty_id`)
);
DROP TABLE IF EXISTS `special_live_m`; CREATE TABLE IF NOT EXISTS `special_live_m` (
    `live_difficulty_id` INTEGER NOT NULL,
    `live_setting_id` INTEGER NOT NULL,
    `capital_type` INTEGER NOT NULL,
    `capital_value` INTEGER NOT NULL,
    `c_rank_complete` INTEGER NOT NULL,
    `b_rank_complete` INTEGER NOT NULL,
    `a_rank_complete` INTEGER NOT NULL,
    `s_rank_complete` INTEGER NOT NULL,
    `exclude_clear_count_flag` INTEGER NOT NULL,
    `exclude_effort_point_flag` INTEGER NOT NULL,
    `exclude_live_bonus_flag` INTEGER NOT NULL,
    PRIMARY KEY (`live_difficulty_id`)
);
DROP TABLE IF EXISTS `special_live_rotation_m`; CREATE TABLE IF NOT EXISTS `special_live_rotation_m` (
    `rotation_group_id` INTEGER NOT NULL,
    `live_difficulty_id` INTEGER NOT NULL,
    `base_date` VARCHAR(128) NOT NULL,
    PRIMARY KEY (`rotation_group_id`,`base_date`)
);
DROP TABLE IF EXISTS `free_live_m`; CREATE TABLE IF NOT EXISTS `free_live_m` (
    `live_difficulty_id` INTEGER NOT NULL,
    `live_setting_id` INTEGER NOT NULL,
    `random_flag` INTEGER NOT NULL,
    PRIMARY KEY (`live_difficulty_id`)
);
DROP TABLE IF EXISTS `live_combo_m`; CREATE TABLE IF NOT EXISTS `live_combo_m` (
    `combo_cnt` INTEGER NOT NULL,
    `combo_asset` VARCHAR(128) NOT NULL,
    `score_rate` REAL NOT NULL,
    `add_love_cnt` INTEGER NOT NULL,
    `release_tag` VARCHAR(4096), `_encryption_release_id` INTEGER NULL,
    PRIMARY KEY (`combo_cnt`)
);
DROP TABLE IF EXISTS `live_unit_reward_lot_m`; CREATE TABLE IF NOT EXISTS `live_unit_reward_lot_m` (
    `live_unit_reward_lot_id` INTEGER NOT NULL,
    `difficulty` INTEGER NOT NULL,
    `condition_type` INTEGER NOT NULL,
    `rank` INTEGER,
    `live_unit_reward_group_id` INTEGER NOT NULL,
    `weight` INTEGER NOT NULL,
    PRIMARY KEY (`live_unit_reward_lot_id`)
);
DROP TABLE IF EXISTS `live_goal_reward_m`; CREATE TABLE IF NOT EXISTS `live_goal_reward_m` (
    `live_goal_reward_id` INTEGER NOT NULL,
    `live_difficulty_id` INTEGER NOT NULL,
    `live_goal_type` INTEGER NOT NULL,
    `rank` INTEGER NOT NULL,
    `add_type` INTEGER NOT NULL,
    `item_id` INTEGER NOT NULL,
    `item_category_id` INTEGER,
    `amount` INTEGER NOT NULL,
    `item_option` VARCHAR(128),
    PRIMARY KEY (`live_goal_reward_id`)
);
DROP TABLE IF EXISTS `live_note_score_factor_m`; CREATE TABLE IF NOT EXISTS `live_note_score_factor_m` (
    `effect_id` INTEGER NOT NULL,
    `difficulty` INTEGER NOT NULL,
    `score_factor` REAL NOT NULL,
    PRIMARY KEY (`effect_id`,`difficulty`)
);
DROP TABLE IF EXISTS `random_live_background_m`; CREATE TABLE IF NOT EXISTS `random_live_background_m` (
    `member_category` INTEGER NOT NULL,
    `difficulty` INTEGER NOT NULL,
    `background_asset` VARCHAR(128) NOT NULL,
    `release_tag` VARCHAR(4096), `_encryption_release_id` INTEGER NULL,
    PRIMARY KEY (`member_category`,`difficulty`)
);
DROP TABLE IF EXISTS `live_cutin_brightness_m`; CREATE TABLE IF NOT EXISTS `live_cutin_brightness_m` (
    `live_cutin_brightness_id` INTEGER NOT NULL,
    `brightness` INTEGER NOT NULL,
    PRIMARY KEY (`live_cutin_brightness_id`)
);
DROP TABLE IF EXISTS `training_mode_m`; CREATE TABLE IF NOT EXISTS `training_mode_m` (
    `training_mode_id` INTEGER NOT NULL,
    `recovery_cost` INTEGER NOT NULL,
    `start_date` VARCHAR(128) NOT NULL,
    PRIMARY KEY (`training_mode_id`)
);
DROP TABLE IF EXISTS `live_time_m`; CREATE TABLE IF NOT EXISTS `live_time_m` (
    `live_track_id` INTEGER NOT NULL,
    `live_time` REAL NOT NULL,
    PRIMARY KEY (`live_track_id`)
);
DROP TABLE IF EXISTS `live_skill_icon_m`; CREATE TABLE IF NOT EXISTS `live_skill_icon_m` (
    `skill_effect_type` INTEGER NOT NULL,
    `icon_asset` VARCHAR(128) NOT NULL,
    `icon_order` INTEGER NOT NULL,
    `release_tag` VARCHAR(4096), `_encryption_release_id` INTEGER NULL,
    PRIMARY KEY (`skill_effect_type`)
);
CREATE INDEX `idx_live_difficulty_id` ON `live_goal_reward_m`(`live_difficulty_id`);
COMMIT;
